import React from "react";
import "./list.scss";
import Card from "../Card/Card";

const List = () => {
  const data = [{}];
  return (
    <div className="list">
      {data?.map((item) => (
        <Card item={item} key={item.id} />
      ))}
    </div>
  );
};

export default List;
